{"Абрикос":[{"brand":"","desc":"Родина абрикоса - Китай. По Великому Шелковому Пути он был завезен в Средиземноморский бассейн. С лечебной целью абрикосы употребляют при малокровии и болезнях сердца. Плоды абрикоса широко используются для приготовления компотов, варенья, джемов, цукатов, желе, мармелада, повидла, соков. Они очень вкусны в свежем виде. ","mark":"","unit":"шт","volumes":[[10.0,900.0,true]]}],"Абрикосовый ликер":[{"brand":"Bols Apricot","desc":"Под торговой маркой Bols выпускается более 30 самых разнообразных ликеров. Бармены всего мира используют его для приготовления всевозможных коктейлей.","mark":"Bols","unit":"л","volumes":[[0.7,885.0,true]]}],"Абрикосовый сок":[{"brand":"Pago Apricot","desc":"Содержит много солей кальция и железа, поэтому он очень полезен маленьким детям и беременным женщинам. 150 г сока удовлетворяют суточную потребность человека в каротине. Сок усваивается организмом легче, чем плоды.","mark":"Pago","unit":"л","volumes":[[1.0,71.0,true]]}],"Абсент":[{"brand":"Xenta","desc":"Xenta - мировой лидер среди абсентов. Напиток № 1 во многих европейских странах. Уникальный цвет, натуральный вкус и стильный дизайн делают его неотъемлемым атрибутом богемной жизни.","mark":"Xenta","unit":"л","volumes":[[0.7,1079.0,true],[0.5,826.0,true]]}],"Адвокат":[{"brand":"","desc":"Ярко-жёлтый датский ликёр, смесь виноградного бренди и эг-нога (то есть яичных желтков и сахара), очень гладкой, однородной, вельветовой текстуры. \nКрепость в большинстве случаев составляет от 14 % до 20 %, что делает его сравнимым с креплёными винами. Используется в смешанных коктейлях — сам по себе он настолько густой, что его нужно подавать с ложкой. \n","mark":"","unit":"л","volumes":[[0.7,798.0,true]]}],"Амаретто":[{"brand":"Disaronno","desc":"Оригинальный амаретто ликер Disaronno своими корнями выходит из района Саронно в Италии. Миндальные нотки и легкий вкус идеально подчеркивают вкус и придают коктейлям особенный аромат.","mark":"Disaronno","unit":"л","volumes":[[1.0,997.0,true],[0.7,718.0,true],[0.5,522.0,true]]}],"Ананас":[{"brand":"","desc":"Удивительный фрукт содержит практически все витамины и минеральные вещества, существующие в природе.","mark":"","unit":"шт","volumes":[[1.0,200.0,true]]}],"Ананасовые листья":[{"brand":"","desc":"Собраны в розетку, в длину достигают 90 см, жесткие, как правило, с колючками по краям.\n","mark":"","unit":"шт","volumes":[[10.0,100.0,true]]}],"Ананасовый сок":[{"brand":"Ананасовый сок Rich","desc":"Соки Rich - неповторимое удовольствие, высочайшее качество и огромное разнообразие вкусов отборных фруктов. ","mark":"Rich","unit":"л","volumes":[[1.0,65.0,true]]}],"Ангостура биттер":[{"brand":"Angostura bitter","desc":"Биттер Angostura сделан по секретной формуле, сочетающей природные травы и специи. Легкая горечь биттера усиливает вкусовые качества коктейля и придает особенное приятное послевкусие.","mark":"Angostura","unit":"л","volumes":[[0.2,410.0,true]]}],"Апельсин":[{"brand":"","desc":"В плодах апельсина содержатся витамины С, В1, В2, В6, Р, провитамин А, пектиновые и азотистые вещества, углеводы, клетчатка, зола, фитонциды, минеральные вещества: калий, фосфор, кальций. Кожура апельсина содержит эфирные масла. ","mark":"","unit":"шт","volumes":[[1.0,20.0,true]]}],"Апельсин карамелизированный":[{"brand":"","desc":"Порежь апельсин кружочками, каждый кружок посыпь сахарным песком с обеих сторон и запекай в духовке примерно 20 минут.","mark":"","unit":"шт","volumes":[[8.0,25.0,true]]}],"Апельсиновый ликер":[{"brand":"Bols Triple Sec","desc":"Под торговой маркой Bols выпускается более 30 самых разнообразных ликеров. Бармены всего мира используют его для приготовления всевозможных коктейлей.","mark":"Bols","unit":"л","volumes":[[0.7,784.0,true]]}],"Апельсиновый сок":[{"brand":"Апельсиновый сок Rich","desc":"Соки Rich - неповторимое удовольствие, высочайшее качество и огромное разнообразие вкусов отборных фруктов. ","mark":"Rich","unit":"л","volumes":[[1.0,65.0,true]]}],"Арбуз":[{"brand":"","desc":"Содержит большое количество жидкости и витаминов. По содержанию железа арбуз уступает только листьям салата и шпинату. ","mark":"","unit":"шт","volumes":[[1.0,150.0,true]]}],"Арбузный сироп":[{"brand":"Monin Watermelon","desc":"Monin производит отличные сиропы во Франции с 1912 г. Богат изобилием ароматов, фруктов и цветовых оттенков. Бармены 32 стран признали Monin - лучшей маркой сиропов.\n","mark":"Monin","unit":"л","volumes":[[0.7,455.0,true]]}],"Базилик":[{"brand":"","desc":"Пряно-ароматическое растение, родиной которого считают Южную Азию. В состав эфирного масла, содержащегося в базилике входит: метилхавинол, цинеол, линалоол, камфору, оцимен, дубильные вещества, кислый сапонин. Так же базилик содержит сахара, каротин, фитонциды, витамин С, В2, РР и рутин.\n","mark":"","unit":"гр","volumes":[[60.0,45.0,true]]}],"Банан":[{"brand":"","desc":"Мякоть банана насыщена аскорбиновой кислотой и магнием. Содержит витамины A, B и C.","mark":"","unit":"шт","volumes":[[1.0,15.0,true]]}],"Банановый ликер":[{"brand":"Bols Creme de Bananes","desc":"Под торговой маркой Bols выпускается более 30 самых разнообразных ликеров. Бармены всего мира используют его для приготовления всевозможных коктейлей.","mark":"Bols","unit":"л","volumes":[[0.7,885.0,true]]}],"Банановый ликер (зеленый)":[{"brand":"Bols Green Banana","desc":"Под торговой маркой Bols выпускается более 30 самых разнообразных ликеров. Бармены всего мира используют его для приготовления всевозможных коктейлей.","mark":"Bols","unit":"л","volumes":[[0.7,784.0,true]]}],"Банановый сироп":[{"brand":"Monin Banana","desc":"Monin производит отличные сиропы во Франции с 1912 г. Богат изобилием ароматов, фруктов и цветовых оттенков. Бармены 32 стран признали Monin - лучшей маркой сиропов.\n","mark":"Monin","unit":"л","volumes":[[0.7,455.0,true]]}],"Бейлис":[{"brand":"Baileys Original","desc":"Ликер Baileys был создан в 1974 году в Ирландии. В состав напитка вошло великое наследие страны - уникальный виски и нежные сливки. Это идеально сочетание позволило ликеру Baileys стать популярным во всем мире.","mark":"Baileys","unit":"л","volumes":[[1.0,1110.0,true],[0.75,849.0,true],[0.5,595.0,true]]}],"Белое вино сухое":[{"brand":"","desc":"","mark":"","unit":"л","volumes":[[0.75,400.0,true]]}],"Белый вермут":[{"brand":"Martini Bianco","desc":"Напиток соломенного цвета с более выраженным, чем у Rosso, ароматом, в котором заметно присутствие малины, лимона и небольшого количества ириса. ","mark":"Martini","unit":"л","volumes":[[1.0,506.0,true],[0.5,300.0,true]]}],"Белый ром":[{"brand":"Bacardi Carta Blanca","desc":"Выдержан как минимум 18 месяцев в дубовых бочках. Обладает сухим, мягким, рафинированным вкусом. Ром категории премиум. Идеальная основа для приготовления как простых, так и самых изысканных коктейлей. Свободный, жизнелюбивый, динамичный.\n","mark":"Bacardi","unit":"л","volumes":[[0.75,1000.0,true]]}],"Бенедиктин":[{"brand":"Benedictine","desc":"Французский ликер на основе бренди, трав и меда. История его столь же особа, как и его вкус. Рецепт ликера известен лишь узкому кругу монахов, проживающих в Нормандии вот уже несколько столетий. Этот всемирно известный ликер производится в Нормандии, на растительной основе с добавлением ароматизирующих веществ.","mark":"Benedictine","unit":"л","volumes":[[1.0,1200.0,true]]}],"Березовый сок":[{"brand":"","desc":"Напиток самой природы. В составе березового сока биологически активные вещества и соединения, минералы: калий, кальций, натрий, магний...","mark":"","unit":"л","volumes":[[1.0,500.0,true]]}],"Биттер вермут":[{"brand":"Martini Bitter","desc":"Данная разновидность вермута является достаточно крепкой. Изготовлен на основе большого количества трав, содержит большее, чем в других, количество добавок, отвечающих за горечь напитка.  ","mark":"Martini","unit":"л","volumes":[[1.0,590.0,true]]}],"Биттер лемон":[{"brand":"Schweppes bitter lemon","desc":"Создан компанией Schweppes в начале 60-х. Он содержит натуральный лимонный сок, который придает напитку золотистый оттенок. \n","mark":"Schweppes","unit":"л","volumes":[[2.0,49.0,true]]}],"Блю Курасао ликер":[{"brand":"Bols Blue curacao","desc":"Под торговой маркой Bols выпускается более 30 самых разнообразных ликеров. Бармены всего мира используют его для приготовления всевозможных коктейлей.","mark":"Bols","unit":"л","volumes":[[0.7,885.0,true]]}],"Брусника":[{"brand":"","desc":"Ягоды брусники представляют собой неисчерпаемый ресурс разнообразных витаминов и полезных веществ. Среди натуральных кислот в них содержится аскорбиновая, лимонная, щавелевая и яблочная. Ягоды используются как профилактическое средство против простуд, укрепляют иммунитет.","mark":"","unit":"гр","volumes":[[50.0,74.0,true]]}],"Брусничный морс":[{"brand":"Брусничный морс Чудо-Ягода","desc":"Чудо ягода - неповторимое удовольствие, высочайшее качество и огромное разнообразие вкусов отборных ягод.","mark":"Чудо-Ягода","unit":"л","volumes":[[1.0,71.0,true]]}],"Ваниль в стручках":[{"brand":"","desc":"Ваниль – одна из немногих специй, которая не раздражает желудок. Стручки ванили хорошего качества обычно 10 - 20 сантиметров длиной, мягкие, эластичные, закругленные, маслянистые на ощупь, темно-коричневые или почти черные. Лучшие сорта покрыты вдобавок налетом беловатых кристаллов.\n\n","mark":"","unit":"шт","volumes":[[1.0,30.0,true]]}],"Ванильное мороженое":[{"brand":"","desc":"","mark":"","unit":"гр","volumes":[[500.0,90.0,true]]}],"Ванильный сироп":[{"brand":"Monin Vanilla","desc":"Monin производит отличные сиропы во Франции с 1912 г. Богат изобилием ароматов, фруктов и цветовых оттенков. Бармены 32 стран признали Monin - лучшей маркой сиропов.\n","mark":"Monin","unit":"л","volumes":[[0.7,402.0,true]]}],"Варенье абрикосовое":[{"brand":"","desc":"Один из наиболее распространенных видов заготовки продуктов. Оно получается при уваривании плодов, ягод и некоторых овощей с сахаром или сахарным сиропом.","mark":"","unit":"гр","volumes":[[245.0,81.0,true]]}],"Варенье клюквенное":[{"brand":"","desc":"Один из наиболее распространенных видов заготовки продуктов. Оно получается при уваривании плодов, ягод и некоторых овощей с сахаром или сахарным сиропом. ","mark":"","unit":"гр","volumes":[[230.0,70.0,true]]}],"Варенье облепиховое":[{"brand":"","desc":"Один из наиболее распространенных видов заготовки продуктов. Оно получается при уваривании плодов, ягод и некоторых овощей с сахаром или сахарным сиропом.","mark":"","unit":"гр","volumes":[[250.0,43.0,true]]}],"Вересковый чай":[{"brand":"","desc":"\n","mark":"","unit":"гр","volumes":[[100.0,100.0,true]]}],"Взбитые сливки":[{"brand":"","desc":"Коктейли со взбитыми сливками гармоничные и мягкие по вкусу.","mark":"","unit":"гр","volumes":[[250.0,80.0,true]]}],"Виноград зеленый":[{"brand":"","desc":"Ягоды винограда содержат оптимальный набор витаминов: кальций, цинк и магний, витамины А, B и С.","mark":"","unit":"гр","volumes":[[1000.0,300.0,true]]}],"Виноград красный":[{"brand":"","desc":"Ягоды винограда содержат оптимальный набор витаминов: кальций, цинк и магний, витамины А, B и С.","mark":"","unit":"гр","volumes":[[1000.0,300.0,true]]}],"Виноградный сок":[{"brand":"Виноградный сок Rich","desc":"Соки Rich - неповторимое удовольствие, высочайшее качество и огромное разнообразие вкусов отборных фруктов.","mark":"Rich","unit":"л","volumes":[[1.0,70.0,true]]}],"Виноградный сок (светлый)":[{"brand":"","desc":"Является наиболее питательным и калорийным соком. Виноградный сок занимает одно из первых мест по содержанию витамина Р, который благотворно действует на укрепление капиллярных сосудов. Виноградный сок повышает обмен веществ в организме, благотворно действует при легочных заболеваниях, а также заболеваниях сердечно-сосудистой системы, болезнях почек и печени, способствует быстрому восстановлению сил. ","mark":"","unit":"л","volumes":[[1.0,72.0,true]]}],"Виски":[{"brand":"William Lawsons","desc":"Виски William Lawson’s известен с 1849 года. Этот напиток отличает традиционный метод производства. Знатоки по всему миру ценят его, прежде всего, за отменное качество. Мягкость и особый вкус William Lawson's высоко ценится любителями скотча во всем мире. Крепость 40%.","mark":"William Lawsons","unit":"л","volumes":[[1.0,693.0,true]]}],"Вишневый ликер":[{"brand":"Bols Cherry Brandy","desc":"Под торговой маркой Bols выпускается более 30 самых разнообразных ликеров. Бармены всего мира используют его для приготовления всевозможных коктейлей.","mark":"Bols","unit":"л","volumes":[[0.7,885.0,true]]}],"Вишневый сироп":[{"brand":"Monin Cherry","desc":"Monin производит отличные сиропы во Франции с 1912 г. Богат изобилием ароматов, фруктов и цветовых оттенков. Бармены 32 стран признали Monin - лучшей маркой сиропов.\n","mark":"Monin","unit":"л","volumes":[[0.7,355.0,true]]}],"Вишневый сок":[{"brand":"Вишневый сок Rich","desc":"Соки Rich - неповторимое удовольствие, высочайшее качество и огромное разнообразие вкусов отборных фруктов. ","mark":"Rich","unit":"л","volumes":[[1.0,70.0,true]]}],"Вишня":[{"brand":"","desc":"Плоды вишни содержат сахара, витамин С и органические кислоты. Они улучшают состояние здоровья человека, в частности, являются прекрасным тонизирующим средством, повышающим иммунитет.","mark":"","unit":"гр","volumes":[[1000.0,200.0,true]]}],"Вода":[{"brand":"Аква Минерале","desc":"Аква Минерале - вода для молодых, энергичных, динамичных людей, достигающих успеха, живущих преимущественно в городах, и заботящихся о своем здоровье и современном стиле жизни.","mark":"Аква Минерале","unit":"л","volumes":[[2.0,35.0,true],[0.6,25.0,true]]}],"Водка":[{"brand":"Русский Стандарт Original","desc":"Бренд, признанный эталоном русской водки в России, на родине этого напитка. Марка создана в полном соответствии с формулой Менделеева и, как и подобает классической русской водке, имеет мягкий и чистый вкус с легким хлебным оттенком.","mark":"Русский Стандарт","unit":"л","volumes":[[1.0,600.0,true],[0.75,450.0,true],[0.5,320.0,true]]}],"Водка ванильная":[{"brand":"Absolut Vanilia","desc":"С тех пор, как бутылка водки Absolut попалась на глаза Энди Уорхолу, ABSOLUT, искусство и коктейльная культура стали неразрывными понятиями.","mark":"Absolut","unit":"л","volumes":[[0.75,665.0,true]]}],"Водка малиновая":[{"brand":"Absolut Raspberry","desc":"С тех пор, как бутылка водки Absolut попалась на глаза Энди Уорхолу, ABSOLUT, искусство и коктейльная культура стали неразрывными понятиями.","mark":"Absolut","unit":"л","volumes":[[0.75,665.0,true]]}],"Водка мандариновая":[{"brand":"Absolut Mandarin","desc":"С тех пор, как бутылка водки Absolut попалась на глаза Энди Уорхолу, ABSOLUT, искусство и коктейльная культура стали неразрывными понятиями.","mark":"Absolut","unit":"л","volumes":[[0.75,665.0,true]]}],"Водка перечная":[{"brand":"Absolut Peppar","desc":"С тех пор, как бутылка водки Absolut попалась на глаза Энди Уорхолу, ABSOLUT, искусство и коктейльная культура стали неразрывными понятиями.","mark":"Absolut","unit":"л","volumes":[[0.75,665.0,true]]}],"Водка цитрон":[{"brand":"Absolut Citron","desc":"С тех пор, как бутылка водки Absolut попалась на глаза Энди Уорхолу, ABSOLUT, искусство и коктейльная культура стали неразрывными понятиями.","mark":"Absolut","unit":"л","volumes":[[0.5,560.0,true]]}],"Ворчестер соус":[{"brand":"Appel","desc":"Секрет приготовления соуса держится в секрете уже более 160 лет и никто, кроме потомков основателей, не знает, какой ингредиент придает соусу этот удвительный экстра вкус. ","mark":"Appel","unit":"л","volumes":[[0.14,200.0,true]]}],"Гальяно":[{"brand":"Galliano","desc":"Galliano создан в 1896 году Артуром Вакари, итальянским мастером дистилляции, в честь героя Италии, участника колониальной войны в Африке, генерала Гальяно. При производстве ликера используется более 30 различных трав и ароматов. Благодаря уникальному и многогранному вкусу и аромату является незаменимым компонентом огромного количества коктейлей. ","mark":"Galliano","unit":"л","volumes":[[0.7,1165.0,true]]}],"Гальяно бальзамик":[{"brand":"Galliano Balsamico","desc":"Galliano создан в 1896 году Артуром Вакари, итальянским мастером дистилляции, в честь героя Италии, участника колониальной войны в Африке, генерала Гальяно. При производстве ликера используется более 30 различных трав и ароматов. Благодаря уникальному и многогранному вкусу и аромату является незаменимым компонентом огромного количества коктейлей. ","mark":"Galliano","unit":"л","volumes":[[0.7,1165.0,true]]}],"Гвоздика":[{"brand":"","desc":"Гвоздика содержит в большом количестве эфирное масло. Витамины А, В1, В2, РР, С; минеральные вещества магний, кальций, натрий, фосфор, железо. ","mark":"","unit":"гр","volumes":[[18.0,20.0,true]]}],"Голубика":[{"brand":"","desc":"Ягоды голубики содержат в себе сахара, витамин С, органические кислоты, дубильные вещества. ","mark":"","unit":"гр","volumes":[[500.0,400.0,true]]}],"Гранат":[{"brand":"","desc":"Снаряд здоровья содержит клетчатку, танин, кальций, магний, калий, марганец, кобальт, витамины B, C и PP. ","mark":"","unit":"шт","volumes":[[1.0,50.0,true]]}],"Гранатовый сок":[{"brand":"","desc":"Содержит значительное количество глюкозы и фруктозы, органические кислоты и 15 аминокислот, в том числе 6 незаменимых, витамины: С, В1, В2, Е, А, РР и другие микроэлементы. Рекомендуется при лечении гипертонии и болезней желудочно-кишечного тракта. Способствует повышению уровня гемоглобина в крови.\n","mark":"","unit":"л","volumes":[[1.0,75.0,true]]}],"Гранд Марнье":[{"brand":"Grand Marnier Cordon Rouge","desc":"Ликёр GRAND MARNIER был создан в 1880 году Луи-Александром Марнье Лапостолем, который воплотил в жизнь смелую идею соединить терпкость диких апельсинов с ароматом благородного коньяка. ","mark":"Grand Marnier","unit":"л","volumes":[[0.7,1400.0,true]]}],"Грейпфрут":[{"brand":"","desc":"В одном грейпфруте содержится дневная норма витамина С. Этот плод также содержит витамины В, D, Р, А, ценные органические кислоты, пектиновые вещества, минералы (натрий, калий, кальций, магний, фосфор, железо) и клетчатку.","mark":"","unit":"шт","volumes":[[5.0,250.0,true]]}],"Грейпфрутовый сок":[{"brand":"Грейпфрутовый сок Rich","desc":"Соки Rich - неповторимое удовольствие, высочайшее качество и огромное разнообразие вкусов отборных фруктов. ","mark":"Rich","unit":"л","volumes":[[1.0,70.0,true]]}],"Гренадин":[{"brand":"Monin Grenadine","desc":"Monin производит отличные сиропы во Франции с 1912 г. Богат изобилием ароматов, фруктов и цветовых оттенков. Бармены 32 стран признали Monin - лучшей маркой сиропов.\n","mark":"Monin","unit":"л","volumes":[[0.7,300.0,true]]}],"Грецкий орех":[{"brand":"","desc":"Содержит витамины группы А, Е, В, Р, С, минеральные вещества: калий, натрий, фосфор, железо, магний, кальций, йод. Грецкий орех  является прекрасным источником белка, который может заменить животный белок. В 100 гр грецких орехов содержится больше калорий, чем в плитке шоколада.","mark":"","unit":"гр","volumes":[[300.0,170.0,true]]}],"Груша":[{"brand":"","desc":"Груши содержат глюкозу, фруктозу, сахарозу, витамины А, В1, В2, Е, Р, РР, С, каротин, фолиевую кислоту, различные минеральные соли и клетчатку. \nНа Востоке плоды и листья грушевого дерева давно признаны целебными при многих воспалениях. В плодах груши содержатся уникальные эфирные масла и биологически активные вещества, которые способны повышать защитные силы организма.\n","mark":"","unit":"гр","volumes":[[1000.0,130.0,true]]}],"Грушевый сироп":[{"brand":"Monin Poire","desc":"Monin производит отличные сиропы во Франции с 1912 г. Богат изобилием ароматов, фруктов и цветовых оттенков. Бармены 32 стран признали Monin - лучшей маркой сиропов.","mark":"Monin","unit":"л","volumes":[[0.7,330.0,true]]}],"Гуава":[{"brand":"","desc":"Плод содержит белки, кальций, фосфор, железо, фруктовый сахар, витамины группы В, А, а также клетчатку. В плодах гуавы в 5 раз больше витамина C чем в апельсинах.","mark":"","unit":"шт","volumes":[[1.0,300.0,true]]}],"Джем апельсиновый":[{"brand":"","desc":"Вкусная, густая, желеобразная масса из ягод или фруктов. Джем можно варить не только из одного вида фруктов или ягод, но и комбинировать плоды. Для него пригодны плоды и ягоды зрелые или слегка недозрелые. Перезревшие и мятые плоды содержат мало пектина, и приготовленный из них джем не будет иметь правильную консистенцию. ","mark":"","unit":"гр","volumes":[[380.0,58.0,true]]}],"Джем вишневый":[{"brand":"","desc":"Вкусная, густая, желеобразная масса из ягод или фруктов. Джем можно варить не только из одного вида фруктов или ягод, но и комбинировать плоды. Для него пригодны плоды и ягоды зрелые или слегка недозрелые. Перезревшие и мятые плоды содержат мало пектина, и приготовленный из них джем не будет иметь правильную консистенцию. ","mark":"","unit":"гр","volumes":[[360.0,56.0,true]]}],"Джем клубничный":[{"brand":"","desc":"Вкусная, густая, желеобразная масса из ягод или фруктов. Джем можно варить не только из одного вида фруктов или ягод, но и комбинировать плоды. Для него пригодны плоды и ягоды зрелые или слегка недозрелые. Перезревшие и мятые плоды содержат мало пектина, и приготовленный из них джем не будет иметь правильную консистенцию. ","mark":"","unit":"гр","volumes":[[380.0,58.0,true]]}],"Джем смородиновый":[{"brand":"","desc":"Вкусная, густая, желеобразная масса из ягод или фруктов. Джем можно варить не только из одного вида фруктов или ягод, но и комбинировать плоды. Для него пригодны плоды и ягоды зрелые или слегка недозрелые. Перезревшие и мятые плоды содержат мало пектина, и приготовленный из них джем не будет иметь правильную консистенцию.","mark":"","unit":"гр","volumes":[[380.0,58.0,true]]}],"Джин":[{"brand":"Bombay Sapphire","desc":"Английский Джин Бомбей Сапфир - разновидность лондонского сухого джина. От других джинов он отличается более насыщенным букетом. Все растения для этой марки джина отбираются из тех регионов, где они произрастают и только лучших сортов. Компоненты смешивают в соответствии со старинной формулой, при этом ни один из них не доминирует. Другой отличительной чертой сухого лондонского джина является его необычайно мягкий вкус, который идеально подходит для создания различных коктейлей. ","mark":"Bombay Sapphire","unit":"л","volumes":[[0.75,1861.0,true]]}],"Драмбуи":[{"brand":"Drambuie","desc":"Drambuie обладает элегантным, сложным букетом с тонами мускатного ореха, гвоздики и горных трав. ","mark":"Drambuie","unit":"л","volumes":[[1.0,1756.0,true],[0.75,1400.0,true],[0.5,857.0,true]]}],"Дынный ликер":[{"brand":"Bols Melon","desc":"Под торговой маркой Bols выпускается более 30 самых разнообразных ликеров. Бармены всего мира используют его для приготовления всевозможных коктейлей.","mark":"Bols","unit":"л","volumes":[[0.7,885.0,true]]}],"Дынный сироп":[{"brand":"Monin Melon","desc":"Monin производит отличные сиропы во Франции с 1912 г. Богат изобилием ароматов, фруктов и цветовых оттенков. Бармены 32 стран признали Monin - лучшей маркой сиропов.\n","mark":"Monin","unit":"л","volumes":[[0.7,324.0,true]]}],"Дыня":[{"brand":"","desc":"В дынях содержится большой процент воды, благодаря которой они очень освежают. Так же они содержат легкоусвояемые сахара, крахмал, белки, витамины, клетчатку, пектины, органические кислоты, разнообразные минеральные соли. Особенно много в плодах солей железа и калия. Полезные и лечебные свойства дыни широко применяются для укрепления нервной системы. В мякоти дыни есть вещества, помогающие выработке серотонина - «гормона счастья».","mark":"","unit":"шт","volumes":[[1.0,230.0,true]]}],"Дюшес":[{"brand":"","desc":"Безалкогольный сильногазированный напиток со вкусом груши.","mark":"","unit":"л","volumes":[[1.0,45.0,true]]}],"Егермейстер":[{"brand":"Jagermeister","desc":"Популярный немецкий крепкий ликёр, настоянный на травах. На этикетке бутылки с ликёром изображается олень с крестом в рогах, по легенде привидевшийся святому Губерту, покровителю охотников.\n","mark":"Jagermeister","unit":"л","volumes":[[0.7,742.0,true]]}],"Ежевика":[{"brand":"","desc":"В ягодах ежевики содержатся: каротин; витамин С; В1 и В2, витамин К и другие. ","mark":"","unit":"гр","volumes":[[300.0,400.0,true]]}],"Ежевичный ликер":[{"brand":"De Kuyper Blackberry","desc":"Десять поколений семьи De Kuyper входили в состав руководства фирмой, посвятив себя развитию и совершенствованию производства. И сейчас, три века спустя, эта всемирно известная фирма все еще является семейным предприятием. Успех De Kuyper на мировом рынке в значительной мере определяется качеством и методами производства. ","mark":"De Kuyper","unit":"л","volumes":[[0.7,1001.0,true]]}],"Звездочный анис":[{"brand":"","desc":"Плоды аниса содержат 2-3 процента эфирного масла, в состав которого входит анетол (80-90 процентов), метилхавикол (10 процентов). Именно они создают типичный аромат аниса. Кроме того, плоды аниса содержат белковые вещества, кофейную и хлорогеновую кислоты.","mark":"","unit":"гр","volumes":[[18.0,35.0,true]]}],"Зеленый чай жасминовый":[{"brand":"","desc":"Зеленый чай специально ароматизируют цветами жасмина, дабы придать ему изысканный вкус и дополнительные полезные для организма человека свойства.","mark":"","unit":"гр","volumes":[[100.0,100.0,true]]}],"Зеленый чай сенча":[{"brand":"","desc":"Это самый распространенный, самый простой и самый главный сорт японского зеленого чая.\n","mark":"","unit":"гр","volumes":[[100.0,100.0,true]]}],"Золотая текила":[{"brand":"Cazadores Reposado","desc":"Репосадо (Reposado) - значит «отдохнувший». Текила Казадорес Репосадо более двух месяцев «отдыхает» в новых, небольших бочках из американского белого дуба. Казадорес Репосадо на 100 процентов состоит из дистиллята именно голубой агавы, вот почему у нее такой богатый аромат и вкус! Текила Казадорес Репосадо лучше всего употреблять в составе классических коктейлей на основе текилы или наслаждаться неразбавленной.","mark":"Cazadores","unit":"л","volumes":[[0.75,1660.0,true]]}],"Золотой ром":[{"brand":"Bacardi Gold","desc":"Ром Бакарди Золотой - это запоминающийся, мягкий и выдержанный ром золотистого оттенка, обладающий ненавязчивым вкусовым букетом и классическим качеством Бакарди . Ром Бакарди Золотой - идеальный напиток для тех, кому по душе непринужденное веселье и хорошее времяпрепровождение с друзьями.","mark":"Bacardi","unit":"л","volumes":[[0.75,940.0,true]]}],"Игристое вино сухое":[{"brand":"Martini Brut","desc":"На этикетке Martini Brut можно увидеть королевские гербы Италии, Испании и Португалии, которые свидетельствуют о том, что это вино с конца XIX века поставлялось ко двору этих европейских монархов: королям нельзя отказать в отличном вкусе. ","mark":"Martini","unit":"л","volumes":[[0.75,740.0,true]]}],"Имбирный сироп":[{"brand":"Monin Gingembre","desc":"Monin производит отличные сиропы во Франции с 1912 г. Богат изобилием ароматов, фруктов и цветовых оттенков. Бармены 32 стран признали Monin - лучшей маркой сиропов.","mark":"Monin","unit":"л","volumes":[[0.7,398.0,true]]}],"Имбирный эль":[{"brand":"Schweppes Ginger Ale","desc":"Один из старейших газированных напитков в мире, созданный в 1870 году сразу завоевал сердца ценителей изысканности. Обладает не горьким, мягким, утонченным вкусом и содержит натуральный экстракт имбиря.","mark":"Schweppes","unit":"л","volumes":[[2.0,64.0,true]]}],"Имбирь":[{"brand":"","desc":"В Средние века был завезен в Европу, где использовался в качестве пряности и лекарства. Купцы рассказывали, что имбирь растет на краю света в стране троглодитов, которые зорко его стерегут, чем еще больше поднимали и без того немаленькую цену на чудодейственный корень.","mark":"","unit":"гр","volumes":[[150.0,190.0,true]]}],"Калина":[{"brand":"","desc":"Ягоды калины содержат: дубильные вещества, сахар, очень ценятся своим содержанием витамина С и органическими кислотами. В народной медицине широко использовали сок плодов калины.","mark":"","unit":"гр","volumes":[[50.0,28.0,true]]}],"Кальвадос":[{"brand":"","desc":"Яблочный бренди, получаемый путем перегонки сидра, из французского региона Нижняя Нормандия","mark":"","unit":"л","volumes":[[1.0,1700.0,true]]}],"Кампари":[{"brand":"Campari","desc":"Биттер на основе растений и цитрусовых, созданный в 1861 году в Милане. Своему красному цвету он обязан краске кармин, добываемой из насекомых, называемых \"кошениль\".","mark":"Campari","unit":"л","volumes":[[1.0,830.0,true],[0.75,650.0,true],[0.5,408.0,true]]}],"Карамбола":[{"brand":"","desc":"Плоды карамболы также известные как «тропические звёзды». Плоды хрустящи, сочны и бывают двух разновидностей: кисло-сладкие и сладкие с массивными ребристыми наростами, являются превосходным источником витамина С.","mark":"","unit":"шт","volumes":[[1.0,68.0,true]]}],"Карамельный сироп":[{"brand":"Monin Caramel","desc":"Monin производит отличные сиропы во Франции с 1912 г. Богат изобилием ароматов, фруктов и цветовых оттенков. Бармены 32 стран признали Monin - лучшей маркой сиропов.\n","mark":"Monin","unit":"л","volumes":[[0.7,377.0,true]]}],"Кардамон":[{"brand":"","desc":"В кардамоне содержится кальций, фосфор, железо, магний и цинк. Природного цинка в нем больше, чем в других используемых пряностях. Витамины: В1, В2, В3. ","mark":"","unit":"гр","volumes":[[10.0,12.0,true]]}],"Кашаса":[{"brand":"Yupioca Gold","desc":"Кашаса - означает \"огненная вода\": меткое название - это именно то, что вы почувствуете, сделав глоток. ","mark":"Yupioca ","unit":"л","volumes":[[1.0,1048.0,true]]}],"Квас":[{"brand":"","desc":"Известен более 1000 лет. Получается в результате незавершенного спиртового или спиртового и молочного брожения сусла. Квас полезен для пищеварения, улучшает обмен веществ и благотворно влияет на сердечно-сосудистую систему. ","mark":"","unit":"л","volumes":[[1.5,48.0,true]]}],"Киви":[{"brand":"","desc":"Киви принято считать национальным фруктом Новой Зеландии. Является хорошим источником витаминов С и Е. Кроме того, его кожица багата различными антиоксидантами. \n","mark":"","unit":"шт","volumes":[[1.0,30.0,true]]}],"Кленовый сироп":[{"brand":"Monin Maple Spice","desc":"Monin производит отличные сиропы во Франции с 1912 г. Богат изобилием ароматов, фруктов и цветовых оттенков. Бармены 32 стран признали Monin - лучшей маркой сиропов.","mark":"Monin","unit":"л","volumes":[[0.7,406.0,true]]}],"Клубника":[{"brand":"","desc":"Клубника – богатый источник витамина С. Также содержит антиоксидант – вещество, защищающее от рака.","mark":"","unit":"гр","volumes":[[500.0,500.0,true]]}],"Клубничный ликер":[{"brand":"Bols Strawberry","desc":"Под торговой маркой Bols выпускается более 30 самых разнообразных ликеров. Бармены всего мира используют его для приготовления всевозможных коктейлей.","mark":"Bols","unit":"л","volumes":[[0.7,885.0,true]]}],"Клубничный сироп":[{"brand":"Monin Strawberry","desc":"Monin производит отличные сиропы во Франции с 1912 г. Богат изобилием ароматов, фруктов и цветовых оттенков. Бармены 32 стран признали Monin - лучшей маркой сиропов.\n","mark":"Monin","unit":"л","volumes":[[1.0,400.0,true]]}],"Клюква":[{"brand":"","desc":"Ягоды клюквы - целая кладезь полезных веществ, и в первую очередь, витамина С. ","mark":"","unit":"гр","volumes":[[1000.0,260.0,true]]}],"Клюквенный морс":[{"brand":"Клюквенный морс Чудо-Ягода","desc":"Чудо ягода - неповторимое удовольствие, высочайшее качество и огромное разнообразие вкусов отборных ягод.","mark":"Чудо-Ягода","unit":"л","volumes":[[1.0,75.0,true]]}],"Клюквенный сироп":[{"brand":"Monin Cranberry","desc":"Monin производит отличные сиропы во Франции с 1912 г. Богат изобилием ароматов, фруктов и цветовых оттенков. Бармены 32 стран признали Monin - лучшей маркой сиропов.\n","mark":"Monin","unit":"л","volumes":[[1.0,360.0,true]]}],"Кокосовое пюре":[{"brand":"","desc":"","mark":"","unit":"гр","volumes":[[300.0,300.0,true]]}],"Кокосовый крем":[{"brand":"","desc":"","mark":"","unit":"гр","volumes":[[520.0,320.0,true]]}],"Кокосовый сироп":[{"brand":"Monin Coco","desc":"Monin производит отличные сиропы во Франции с 1912 г. Богат изобилием ароматов, фруктов и цветовых оттенков. Бармены 32 стран признали Monin - лучшей маркой сиропов.\n","mark":"Monin","unit":"л","volumes":[[0.7,405.0,true]]}],"Коктейльная вишня зеленая":[{"brand":"","desc":"","mark":"","unit":"гр","volumes":[[225.0,120.0,true]]}],"Коктейльная вишня красная":[{"brand":"","desc":"","mark":"","unit":"гр","volumes":[[225.0,120.0,true]]}],"Кола":[{"brand":"Coca-Cola","desc":"\"Кока-кола\" появилась в Атланте (штат Джорджия, США) 8 мая 1886 года. Ее изобрёл фармацевт Джон Стит Пембертон, бывший офицер американской Армии конфедерации. \"Кока-кола\" является самым популярным безалкогольным напитком в мире.","mark":"Coca-Cola","unit":"л","volumes":[[2.0,61.0,true],[1.0,47.0,true],[0.5,36.0,true],[0.33,0.0,false],[0.25,0.0,false],[0.15,0.0,false]]}],"Коньяк":[{"brand":"Otard V.S.O.P.","desc":"Единственный коньяк, который рождается и созревает в подвалах королевского Замка Коньяк (Chateau de Cognac), единственный коньяк, о котором можно сказать: «аристократ по происхождению», коньяк для истинных ценителей.","mark":"Otard","unit":"л","volumes":[[0.5,1900.0,true]]}],"Корица в палочках":[{"brand":"","desc":"Богатый источник магния, кальция и марганца.","mark":"","unit":"гр","volumes":[[17.0,22.0,true]]}],"Корица молотая":[{"brand":"","desc":"Богатый источник магния, кальция и марганца.","mark":"","unit":"гр","volumes":[[25.0,22.0,true]]}],"Кофе":[{"brand":"Lavazza qualita oro","desc":"Каждый, кто хоть раз бывал в Милане, знает: по утрам Милан пахнет кофе. Знатоки скажут точнее: миланское утро пахнет кофе Lavazza, ведь трое\nиз четырех итальянцев предпочитают его превосходный вкус любому другому.","mark":"Lavazza","unit":"гр","volumes":[[250.0,500.0,true]]}],"Кофейный ликер":[{"brand":"Bols Coffee","desc":"Под торговой маркой Bols выпускается более 30 самых разнообразных ликеров. Бармены всего мира используют его для приготовления всевозможных коктейлей.","mark":"Bols","unit":"л","volumes":[[0.7,885.0,true]]}],"Красное вино сухое":[{"brand":"Santa Cristina","desc":"Всемирно известное детище семейства Антинори, подтверждающее заслуженную популярность тосканских вин. Семья Антинори занимается виноделием уже более 600 лет (с 1385 года) и входит в почетную Ассоциацию Старейших Винных Семей (Primum Familiae Vini). ","mark":"Santa Cristina","unit":"л","volumes":[[0.75,400.0,true]]}],"Красный вермут":[{"brand":"Martini Rosso","desc":"Самый классический вермут Martini. Традиционная карамель придает этому вермуту темно-янтарный цвет.","mark":"Martini","unit":"л","volumes":[[1.0,522.0,true],[0.5,270.0,true]]}],"Крепленое вино красное":[{"brand":"","desc":"К креплёным винам относят крепкие (портвейн, херес, мадера, марсала) сорта. Обычно содержат 17-20% спирта.","mark":"","unit":"л","volumes":[[0.75,700.0,true]]}],"Куантро":[{"brand":"Cointreau","desc":"","mark":"Cointreau","unit":"л","volumes":[[1.0,1710.0,true],[0.7,1300.0,true]]}],"Кумкват":[{"brand":"","desc":"Плоды кумквата богаты кальцием и калием, витаминами А и С.","mark":"","unit":"гр","volumes":[[1000.0,550.0,true]]}],"Лайм":[{"brand":"","desc":"Отличный транквилизатор, он успокаивающе действует на нервную систему, улучшает общее самочувствие, поднимает настроение. Содержит много витамина C, калий, кальций и фосфор.","mark":"","unit":"шт","volumes":[[1.0,40.0,true]]}],"Лед":[{"brand":"","desc":"Лед - важнейший коктейльный ингредиент. Никогда не забывай о нем. ","mark":"","unit":"кубиков","volumes":[[50.0,40.0,true],[500.0,500.0,true]]}],"Ликер Мандарин Наполеон":[{"brand":"Mandarine Napoleon","desc":"Согласно легенде, этот ликер возник благодаря императору Наполеону I, любившему выпить после еды немного коньяку, в котором вымачивались мандарины. Этот ликер пьется также и на аперитив, с апельсиновым соком, тоникам или в составе коктейлей.","mark":"Mandarine Napoleon","unit":"л","volumes":[[0.7,1100.0,true]]}],"Ликер Сохо личи":[{"brand":"","desc":"Ликер Сохо на основе Личчи с оригинальным вкусом был выпущен в 1989 году для баров и ночных клубов, затем в 1991 году — для розничных точек. Употребляют СОХО обычно со льдом, а также с фруктовыми соками, колой или тоником.","mark":"","unit":"л","volumes":[[0.7,1047.0,true]]}],"Ликер голубики":[{"brand":"Bols Blueberry","desc":"Под торговой маркой Bols выпускается более 30 самых разнообразных ликеров. Бармены всего мира используют его для приготовления всевозможных коктейлей.","mark":"Bols","unit":"л","volumes":[[0.7,885.0,true]]}],"Ликер какао (светлый)":[{"brand":"Bols Cacao White","desc":"Под торговой маркой Bols выпускается более 30 самых разнообразных ликеров. Бармены всего мира используют его для приготовления всевозможных коктейлей.","mark":"Bols","unit":"л","volumes":[[0.7,885.0,true]]}],"Ликер какао (темный)":[{"brand":"Bols Cacao Brown","desc":"Под торговой маркой Bols выпускается более 30 самых разнообразных ликеров. Бармены всего мира используют его для приготовления всевозможных коктейлей.","mark":"Bols","unit":"л","volumes":[[0.7,885.0,true]]}],"Ликер кислая вишня":[{"brand":"Bols Maraschino","desc":"Под торговой маркой Bols выпускается более 30 самых разнообразных ликеров. Бармены всего мира используют его для приготовления всевозможных коктейлей.","mark":"Bols","unit":"л","volumes":[[0.7,885.0,true]]}],"Ликер корицы":[{"brand":"Bols Gold Strike","desc":"Под торговой маркой Bols выпускается более 30 самых разнообразных ликеров. Бармены всего мира используют его для приготовления всевозможных коктейлей.","mark":"Bols","unit":"л","volumes":[[0.7,885.0,true]]}],"Ликер личи":[{"brand":"Bols Lychee","desc":"Под торговой маркой Bols выпускается более 30 самых разнообразных ликеров. Бармены всего мира используют его для приготовления всевозможных коктейлей.","mark":"Bols","unit":"л","volumes":[[0.7,885.0,true]]}],"Ликер манго":[{"brand":"Bols Mango","desc":"Под торговой маркой Bols выпускается более 30 самых разнообразных ликеров. Бармены всего мира используют его для приготовления всевозможных коктейлей.","mark":"Bols","unit":"л","volumes":[[0.7,885.0,true]]}],"Ликер маракуйя":[{"brand":"Bols Passion Fruit","desc":"Под торговой маркой Bols выпускается более 30 самых разнообразных ликеров. Бармены всего мира используют его для приготовления всевозможных коктейлей.","mark":"Bols","unit":"л","volumes":[[0.7,885.0,true]]}],"Лимон":[{"brand":"","desc":"По содержанию витамина С лимону далеко до шиповника и черной смородины, однако он содержит много витамина A, B, C и P.","mark":"","unit":"шт","volumes":[[1.0,20.0,true]]}],"Лимонная трава":[{"brand":"","desc":"Часто именуется также лемонграсс от английского lemon grass — «лимонная трава». Широко используется в кухне Юго-Восточной Азии, особенно в тайской и вьетнамской. Стебли травы содержат вещества, аналогичные содержащимся в лимонной цедре. Она улучшает пищеварение, помогает при ревматизме и головной боли. \n","mark":"","unit":"гр","volumes":[[100.0,130.0,true]]}],"Лимонник":[{"brand":"","desc":"Содержит кристаллическое вещество — схизандрин, эфирные масла, органические кислоты, углеводы, витамин С.\n","mark":"","unit":"гр","volumes":[[1000.0,500.0,true]]}],"Лимончелло":[{"brand":"","desc":"Популярный итальянский лимонный ликёр. По большей части выпускается в южной Италии, в частности, на побережье Амальфи, на островах Капри, Искья, на Сицилии, Сардинии.","mark":"","unit":"л","volumes":[[0.7,1000.0,true]]}],"Листья лайма":[{"brand":"","desc":"Придают особенный аромат коктейлю. Листья лайма - одна из самых распространенных пряностей азии. Содержат большую часть витаминов, что и лайм.\n","mark":"","unit":"гр","volumes":[[1000.0,450.0,true]]}],"Личи":[{"brand":"","desc":"Тропический фрукт, oдин из самых популярных фруктов Юго-Восточной Азии. У него сладкий, с легкой кислинкой вкус и аромат розовых лепестков. Фрукты личи ботаты витамином С и калием. ","mark":"","unit":"гр","volumes":[[1000.0,400.0,true]]}],"Малибу":[{"brand":"Malibu","desc":"Изысканный ликер Malibu c особым кокосовым вкусом идеален для яркой вечеринки; блестящего праздника для тебя и друзей. Malibu является прекрасной основой для множества коктейли и необходимым составляющим любого бара.","mark":"Malibu","unit":"л","volumes":[[0.75,1050.0,true]]}],"Малина":[{"brand":"","desc":"В ягодах малины содержатся: салициловая кислота, витамины А, Е, РР, B2, медь и много железа, витамин С. ","mark":"","unit":"гр","volumes":[[150.0,300.0,true]]}],"Малиновый джем":[{"brand":"","desc":"Свежий летний аромат малины, прекрасно сочетается с газировками и сиропами. Идеален для безалкогольных коктейлей.\n","mark":"","unit":"гр","volumes":[[340.0,70.0,true]]}],"Малиновый сироп":[{"brand":"Monin Raspberry","desc":"Monin производит отличные сиропы во Франции с 1912 г. Богат изобилием ароматов, фруктов и цветовых оттенков. Бармены 32 стран признали Monin - лучшей маркой сиропов.\n","mark":"Monin","unit":"л","volumes":[[0.7,355.0,true]]}],"Манго":[{"brand":"","desc":"В  плодах  манго   содержатся  почти полный набор всех необходимых человеку витаминов (С, Е, В3, В5, В6, каротиноиды) и питательных веществ. ","mark":"","unit":"гр","volumes":[[1000.0,250.0,true]]}],"Манговый сок":[{"brand":"Манговый сок Rich","desc":"Соки Rich - неповторимое удовольствие, высочайшее качество и огромное разнообразие вкусов отборных фруктов. ","mark":"Rich","unit":"л","volumes":[[1.0,70.0,true]]}],"Мандарин":[{"brand":"","desc":"Как и все цитрусовые, манадарины богаты витамином С. Кроме того содержат витамин D, обладающий противорахитным действием, и витамин К, способный обеспечить эластичность кровеносных сосудов. Благодаря наличию лимонной кислоты, в мандаринах никогда не бывает нитратов.","mark":"","unit":"шт","volumes":[[8.0,140.0,true]]}],"Мандариновый ликер":[{"brand":"","desc":"Ликер Mandarine Napoleon приобрел свои качества благодаря выжимке из лучших мандаринов Сицилии и Андалузии, а также благодаря добавлению трав, названия которых держатся в секрете. Выдерживается ликер в течение 3 лет, по истечении которых в ликере проявляется гармоничный богатый и ароматный вкус\n","mark":"","unit":"л","volumes":[[0.7,1171.0,true]]}],"Мандариновый сироп":[{"brand":"Monin Mandarin","desc":"Monin производит отличные сиропы во Франции с 1912 г. Богат изобилием ароматов, фруктов и цветовых оттенков. Бармены 32 стран признали Monin - лучшей маркой сиропов.\n","mark":"Monin","unit":"л","volumes":[[0.7,330.0,true]]}],"Мандариновый сок":[{"brand":"","desc":"Отличный освежающий напиток, обладающий множеством полезных качеств. Полезен при заболеваниях желудочно-кишечного тракта, обладает противомикробным действием благодаря сильным фитонцидам, содержащимся в нем. \n","mark":"","unit":"л","volumes":[[1.0,151.0,true]]}],"Маракуйя":[{"brand":"","desc":"Очень древняя тропическая культура рода Passiflora. Пассифлорой называют незрелый желтый фрукт, а маракуйя - его созревший, темно-фиолетовый вариант. В Австралии фрукт так и называют «passionfruit», что дословно переводится как «фрукт страсти».","mark":"","unit":"гр","volumes":[[500.0,300.0,true]]}],"Масло сливочное соленое":[{"brand":"","desc":"В сливочном масле есть жирорастворимый витамин А и бета-каротин. Чем масло желтее, тем больше в нем этих полезных веществ. \n","mark":"","unit":"гр","volumes":[[250.0,80.0,true]]}],"Мед":[{"brand":"","desc":"Согласно результатам исследований, в меде были обнаружены полезные витамины: B1, В2, В3, В5, В6, В12, Н (биотин), Е, К, С, РР, каротины, пантотеновая и фолиевая кислоты. ","mark":"","unit":"гр","volumes":[[500.0,200.0,true]]}],"Мед цветочный":[{"brand":"","desc":"продукт, полученный из нектара цветков растений. Разные сорта пчелиного меда отличаются друг от друга своим ароматом, являющимся ценным качеством меда. По аромату меда можно судить о его качестве и происхождении. Цветочный мед, включенный в рацион питания человека, приводит к улучшению самочувствия, аппетита. Ежедневное употребление меда стимулирует иммунную защиту организма.","mark":"","unit":"гр","volumes":[[250.0,136.0,true]]}],"Медовый сироп":[{"brand":"Monin Honey","desc":"Monin производит отличные сиропы во Франции с 1912 г. Богат изобилием ароматов, фруктов и цветовых оттенков. Бармены 32 стран признали Monin - лучшей маркой сиропов.\n","mark":"Monin","unit":"л","volumes":[[0.7,390.0,true]]}],"Ментоловый ликер":[{"brand":"Bols Peppermint","desc":"Под торговой маркой Bols выпускается более 30 самых разнообразных ликеров. Бармены всего мира используют его для приготовления всевозможных коктейлей.","mark":"Bols","unit":"л","volumes":[[0.7,885.0,true]]}],"Миндальный сироп":[{"brand":"Monin Almond","desc":"Monin производит отличные сиропы во Франции с 1912 г. Богат изобилием ароматов, фруктов и цветовых оттенков. Бармены 32 стран признали Monin - лучшей маркой сиропов.\n","mark":"Monin","unit":"л","volumes":[[0.7,300.0,true]]}],"Молоко":[{"brand":"","desc":"","mark":"","unit":"л","volumes":[[1.0,35.0,true]]}],"Мультифруктовый сок":[{"brand":"Мультифруктовый сок Rich Live","desc":"Соки Rich - неповторимое удовольствие, высочайшее качество и огромное разнообразие вкусов отборных фруктов. ","mark":"Rich","unit":"л","volumes":[[1.0,77.0,true]]}],"Мускатный орех":[{"brand":"","desc":"В орехе содержится кальций, магний, фосфор, железо. Витамины А, В1, В2, ВЗ.","mark":"","unit":"гр","volumes":[[100.0,100.0,true]]}],"Мята":[{"brand":"","desc":"Аромат мяты с древности олицетворяет чистоту и свежесть. Богата большим содержанием ментола. ","mark":"","unit":"гр","volumes":[[30.0,30.0,true]]}],"Нектарин":[{"brand":"","desc":"Появился в следствие мутации персика и не является результатом скрещивания персика и сливы, как принято считать. Плоды нектарина богаты витаминами А и С.\n","mark":"","unit":"гр","volumes":[[1000.0,500.0,true]]}],"Огурец":[{"brand":"","desc":"Появился в культуре более 6 тыс. лет назад. Родина этого вида — тропические и субтропические районы Индии и Китая.","mark":"","unit":"гр","volumes":[[1000.0,200.0,true]]}],"Оливки":[{"brand":"","desc":"Насыщены жирными кислотами и витаминами A, B и E.","mark":"","unit":"гр","volumes":[[300.0,55.0,true]]}],"Ореховый сироп":[{"brand":"Monin Toffee Nut","desc":"Monin производит отличные сиропы во Франции с 1912 г. Богат изобилием ароматов, фруктов и цветовых оттенков. Бармены 32 стран признали Monin - лучшей маркой сиропов.\n","mark":"Monin","unit":"л","volumes":[[0.7,350.0,true]]}],"Орхидея":[{"brand":"","desc":"Цветы орхидеи очень разнообразны по внешнему виду, размерам и образу жизни. В древнем Китае употребляли даже специальные словосочетания, в которых слово «орхидея» означало доброе отношение, красивый внешний вид или хорошее качество. \n","mark":"","unit":"шт","volumes":[[1.0,400.0,true]]}],"Перец красный молотый":[{"brand":"","desc":"Обладает сильным пряным ароматом и вкусом от пряного до острого и даже жгучего. Для приготовления красного молотого перца свежий острый перец сущат, освобождают от чашечек и перемалывают. Его используют при приготовлении соусов, супов,тушеного мяса, рыбных блюд, маринадов и блюд из риса.","mark":"","unit":"гр","volumes":[[17.0,11.0,true]]}],"Перец красный сладкий":[{"brand":"","desc":"С 1585 года перец стали выращивать в Венгрии, а потом и во всей Европе. Он рекордсмен по содержанию витамина С. Так же перец богат антиоксидантами и микроэлементами, увеличивает выработку организмом — эндорфинов, веществ вызывающих у человека ощущения счастья, богат каротином, много витаминов В1, В2, Е, РР, минеральных веществ и солей калия.","mark":"","unit":"гр","volumes":[[1000.0,170.0,true]]}],"Перец черный молотый":[{"brand":"","desc":"Типичное тропическое растение, хорошо развивающееся только в условиях влажного и жаркого климата. Ягоды собирают недозревшими — зелёными или жёлтыми, но до того, как они начнут краснеть; уборка длится несколько месяцев, так как плоды созревают постепенно. Черный перец еще в средние века перевозили с Индии и острова Ява.\n","mark":"","unit":"гр","volumes":[[20.0,20.0,true]]}],"Перец чили":[{"brand":"","desc":"Получивший свое название еще от ацтеков. Так древние племена называли маленькие и жгучие плоды. Наиболее популярный сорт Халапеньо, самый жгучий Хабанерос.\n\n","mark":"","unit":"шт","volumes":[[50.0,150.0,true]]}],"Персик":[{"brand":"","desc":"Сочный фрукт содержит каротин, фолиевую кислоту и витамин С.","mark":"","unit":"шт","volumes":[[1.0,45.0,true]]}],"Персиковый ликер":[{"brand":"Bols Peach","desc":"Под торговой маркой Bols выпускается более 30 самых разнообразных ликеров. Бармены всего мира используют его для приготовления всевозможных коктейлей.","mark":"Bols","unit":"л","volumes":[[0.7,885.0,true]]}],"Персиковый сироп":[{"brand":"Monin Peach","desc":"Monin производит отличные сиропы во Франции с 1912 г. Богат изобилием ароматов, фруктов и цветовых оттенков. Бармены 32 стран признали Monin - лучшей маркой сиропов.\n","mark":"Monin","unit":"л","volumes":[[0.7,340.0,true]]}],"Персиковый сок":[{"brand":"Персиковый сок Rich","desc":"Соки Rich - неповторимое удовольствие, высочайшее качество и огромное разнообразие вкусов отборных фруктов. ","mark":"Rich","unit":"л","volumes":[[1.0,71.0,true]]}],"Печенье":[{"brand":"","desc":"Делается из различного рода теста с последующим приданием ему определённой формы. Есть варианты с добавлением сладкой начинки и запеканием при высокой температуре. ","mark":"","unit":"гр","volumes":[[50.0,50.0,true]]}],"Пиво светлое":[{"brand":"","desc":"Древний напиток, известный ещё в Древнем Египте пшеницу и ячмень люди там начали культивировать исключительно для приготовления пива, а создание хлеба явилось лишь побочным эффектом.","mark":"","unit":"л","volumes":[[1.0,100.0,true]]}],"Портвейн красный":[{"brand":"","desc":"Дословно, «портвейн» — это «вино из города Порту». Он отличается от других типов вин повышенным средним содержанием алкоголя, от 19% до 22% от объема. Еще одним отличием является то, что цвет и сладость разнятся в зависимости от сорта портвейна. В России к этому напитку несколько предвзятое отношение, однако он благороднее, чем принято считать.","mark":"","unit":"л","volumes":[[0.75,605.0,true]]}],"Ред Булл":[{"brand":"Red Bull","desc":"Энергетический напиток был специально разработан для употребления в периоды повышенной физической и умственной нагрузки. К тому же, Ред Булл бодрит тело и дух.","mark":"Red Bull","unit":"л","volumes":[[0.25,73.0,true],[0.35,83.0,true]]}],"Редька":[{"brand":"","desc":"Редька — просто незаменимое средство для укрепления здоровья. Она содержит минеральные вещества, белки, углеводы, витамины С, В1, В2, органические кислоты, эфирные масла и глюкозиды.","mark":"","unit":"гр","volumes":[[1000.0,50.0,true]]}],"Роза белая":[{"brand":"","desc":"Белая роза - символ духовной близости\n\n\n","mark":"","unit":"шт","volumes":[[1.0,150.0,true]]}],"Роза красная":[{"brand":"","desc":"Роза на сегодняшний день — самый покупаемый цветок в мире.","mark":"","unit":"шт","volumes":[[1.0,150.0,true]]}],"Розмарин":[{"brand":"","desc":"На языке цветов розмарин символизирует верность. Еще в 17 веке обручающиеся вплетали розмарин в свои гирлянды.\nОтличается сильными противовоспалительными и антисептическим эффектом.","mark":"","unit":"гр","volumes":[[50.0,42.0,true]]}],"Розовый вермут":[{"brand":"Martini Rosato","desc":"Единственный вермут, в производстве которого используется розовое вино. Своеобразный тонизирующий напиток приятного розового цвета. Присутствует оттенок корицы и гвоздики. ","mark":"Martini","unit":"л","volumes":[[0.5,400.0,true]]}],"Рукола":[{"brand":"","desc":"Еще в Древнем Риме руколу употребляли как пряность. Сейчас рукола широко используется в кухне стран Средиземноморья.  Она имеет ярко выраженный аромат и острый горчично-ореховый привкус. ","mark":"","unit":"гр","volumes":[[50.0,40.0,true]]}],"Саке":[{"brand":"","desc":"Традиционный японский алкогольный напиток на основе риса. Его крепость, как правило, составляет от 14 до 25 %. Саке принято наливать непосредственно перед каждым тостом, а наполнять свою чашечку самому считается дурным тоном.\n","mark":"","unit":"л","volumes":[[0.36,300.0,true]]}],"Самбука":[{"brand":"Sambuca Molinari","desc":"Итальянский ликер на основе бузины и аниса. Именно присутствие ягод бузины отличает его от всех анисовых \"коллег\", включая пастис и узо. Не пейте, пока пламя не погаснет, если только вы не профессиональный глотатель огня.","mark":"Molinari","unit":"л","volumes":[[0.7,900.0,true]]}],"Сахар ванильный":[{"brand":"","desc":"Сахар в смеси с ванилином. Это наиболее распространенная и наиболее употребительная ароматическая добавка в кулинарии.","mark":"","unit":"гр","volumes":[[8.0,14.0,true]]}],"Сахарная пудра":[{"brand":"","desc":"Мелко размолотый сахарный песок, в котором уже не ощущаются отдельные кристаллы. Также ее называют сахарной пылью. ","mark":"","unit":"гр","volumes":[[250.0,20.0,true]]}],"Сахарный песок":[{"brand":"","desc":"«Сыпучий» сахар (его также называют «дроблёным», «молотым», «гранулированным» или «сахарным песком») важен в кулинарии больше, чем любой другой: именно его чаще всего используют как подсластитель различных блюд.","mark":"","unit":"гр","volumes":[[500.0,60.0,true]]}],"Сахарный сироп":[{"brand":"Monin Pure Cane Sugar","desc":"Monin производит отличные сиропы во Франции с 1912 г. Богат изобилием ароматов, фруктов и цветовых оттенков. Бармены 32 стран признали Monin - лучшей маркой сиропов.\n","mark":"Monin","unit":"л","volumes":[[0.7,280.0,true]]}],"Сгущенное молоко":[{"brand":"","desc":"Получается путем выпаривания цельного пастеризованного молока, часто с добавлением сахара. Сгущенное молоко было  запатентовано в 1856 году американцем Гейлом Борденом.\n","mark":"","unit":"гр","volumes":[[380.0,22.0,true]]}],"Сельдереевая соль":[{"brand":"","desc":"Известная нам по сельдереевым диетам, сельдереевая соль снижает воздействие алкоголя и делает коктейль по-настоящему насыщенным.","mark":"","unit":"гр","volumes":[[300.0,300.0,true]]}],"Сельдерей":[{"brand":"","desc":"Содержит калий, магний, кальций, марганец, железо, цинк, фосфор, натрий, а также витамины группы В, витамины К и Е, провитамин А и аскорбиновую кислоту.","mark":"","unit":"шт","volumes":[[1.0,25.0,true]]}],"Серебряная текила":[{"brand":"Cazadores Blanco","desc":"Мягкая, «легкая» текила. На 100% - из сорта голубой агавы. Великолепно сочетается с другими напитками. Благодаря сладковатому аромату и мягкому вкусу идеально подходит для употребления в составе коктейлей.","mark":"Cazadores","unit":"л","volumes":[[0.75,1380.0,true]]}],"Сироп голубика":[{"brand":"Monin Blueberry","desc":"Monin производит отличные сиропы во Франции с 1912 г. Богат изобилием ароматов, фруктов и цветовых оттенков. Бармены 32 стран признали Monin - лучшей маркой сиропов.\n","mark":"Monin","unit":"л","volumes":[[0.7,436.0,true]]}],"Сироп корицы":[{"brand":"Monin Cannelle","desc":"Monin производит отличные сиропы во Франции с 1912 г. Богат изобилием ароматов, фруктов и цветовых оттенков. Бармены 32 стран признали Monin - лучшей маркой сиропов.","mark":"Monin","unit":"л","volumes":[[0.7,383.0,true]]}],"Сироп маракуйя":[{"brand":"Monin Passion Fruit","desc":"Monin производит отличные сиропы во Франции с 1912 г. Богат изобилием ароматов, фруктов и цветовых оттенков. Бармены 32 стран признали Monin - лучшей маркой сиропов.\n","mark":"Monin","unit":"л","volumes":[[0.7,330.0,true]]}],"Сироп розы":[{"brand":"Monin Rose","desc":"Monin производит отличные сиропы во Франции с 1912 г. Богат изобилием ароматов, фруктов и цветовых оттенков. Бармены 32 стран признали Monin - лучшей маркой сиропов.\n","mark":"Monin","unit":"л","volumes":[[0.7,404.0,true]]}],"Сливки":[{"brand":"","desc":"Жиросодержащая часть отстоявшегося молока, которую можно слить. Сливки содержат калий, натрий, кальций, магний, фосфор, железо, витамины А, В1, В2, РР и С. Для приготовления коктейлей лучше использовать жирные сливки (33%). ","mark":"","unit":"л","volumes":[[0.2,50.0,true]]}],"Сливовое вино":[{"brand":"","desc":"Производят из сливы уме. Этот уникальный японский фрукт отличается высоким содержанием фруктовых кислот и терпким кисловатым вкусом. Рецепт производства сливового вина существует около 400 лет. Оно бывает желтоватого и зеленоватого цвета. Обычно срок выдержки составляет от 6-и месяцев до одного года, в результате получается ароматный, сладкий напиток. ","mark":"","unit":"л","volumes":[[0.7,450.0,true]]}],"Смородина красная":[{"brand":"","desc":"Ягоды красной смородины содержат витамины А, С и Е. В скандинавских странах часто используется для приготовления фруктовых супов и пуддингов.\n","mark":"","unit":"гр","volumes":[[130.0,160.0,true]]}],"Смородина черная":[{"brand":"","desc":"Ягоды смородины отличает уникальный состав и предельная концентрация витаминов. Белки, углеводы, клетчатка, целый ряд органических кислот, витамины, каротин, минералы — всё это собрали в себе плоды скромного на вид растения.\n","mark":"","unit":"гр","volumes":[[130.0,160.0,true]]}],"Содовая":[{"brand":"Bon Aqua","desc":"","mark":"Bon Aqua","unit":"л","volumes":[[2.0,40.0,true],[0.5,30.0,true]]}],"Соленый огурец":[{"brand":"","desc":"26 августа 2007 года русскому солёному огурцу исполнилось 500 лет.","mark":"","unit":"шт","volumes":[[20.0,150.0,true]]}],"Соль":[{"brand":"","desc":"Является единственной в своем роде минеральной приправой.","mark":"","unit":"гр","volumes":[[1000.0,20.0,true]]}],"Соль морская":[{"brand":"","desc":"Получают из вод Адриатического моря уже более 700 лет выпариванием морской воды на солнце. Морская соль содержит больше ионов магния, калия, йода, кальция, фтора, а также других морских минералов. Потребление 5-10 г соли в сутки обеспечивает суточную потребность человека в йоде.","mark":"","unit":"гр","volumes":[[150.0,55.0,true]]}],"Сорбет лайм":[{"brand":"","desc":"сорбеты были первыми ледяными десертами. В переводе «сорбет» означает просто «пить». Изначально его  делали из фруктов, меда, ароматических добавок и снега. Сегодня сорбет подается как десерт или как закуска между блюдами, чтобы перебить послевкусие и подготовиться к следующему блюду.","mark":"","unit":"гр","volumes":[[175.0,112.0,true]]}],"Спирулина (в таблетках)":[{"brand":"","desc":"Спирулина - это синезеленая водоросль, которая очень богата белком. Так же в ней содержится кальций, железо, натрий, цинк, фосфор и другие активные вещества.\n","mark":"","unit":"таб","volumes":[[60.0,670.0,true]]}],"Спрайт":[{"brand":"Sprite","desc":"Безалкогольный газированный напиток компании The Coca-Cola Company. Запомнился своей жизнерадостной рекламой: \"Не дай себе засохнуть!\". Тонизирует и освежает.","mark":"Sprite","unit":"л","volumes":[[2.0,42.0,true],[1.0,32.0,true],[0.5,26.0,true],[0.33,0.0,false],[0.2,0.0,false],[0.15,0.0,false]]}],"Сухой вермут":[{"brand":"Martini Extra Dry","desc":"Напиток соломенного цвета, в котором заметно присутствие малины, лимона и небольшого количества ириса.","mark":"Martini","unit":"л","volumes":[[1.0,506.0,true],[0.5,300.0,true]]}],"Табаско соус":[{"brand":"Tabasco","desc":"Соус TABASCO по шкале Сковилла имеет 7000 – 8000 баллов, что делает его самым острым из известных на сегодняшний день соусов, оставляющим все другие далеко позади. ","mark":"Tabasco","unit":"л","volumes":[[0.25,500.0,true]]}],"Тамаринд соус":[{"brand":"","desc":"Тамаринд — это тропическое дерево, родом из восточной Африки. Еще его называют «индийский финик». Мякоть плодов тамаринда используется в качестве специи в азиатских и латиноамериканских кухнях. Тамаринд содержит витамин А и органические кислоты.","mark":"","unit":"л","volumes":[[0.25,203.0,true]]}],"Темный ром":[{"brand":"Bacardi Black","desc":"Ром категории премиум, изысканный и элегантный. Выдержан как минимум 4 года в дубовых бочках. Мягкий и богатый вкус, который доступен для более зрелых и опытных потребителей.\n","mark":"Bacardi","unit":"л","volumes":[[0.75,1000.0,true]]}],"Тимьян":[{"brand":"","desc":"Происходит из стран Средиземноморья. В пищу употребляются листья и цветы этого растения, которые можно собирать три раза в сезон. Трава тимьяна содержит эфирное масло, дубильные и горькие вещества, камедь, смолу, флавоноиды, органические, минеральные соли. ","mark":"","unit":"гр","volumes":[[50.0,43.0,true]]}],"Томатный сок":[{"brand":"Томатный сок Rich","desc":"Соки Rich - неповторимое удовольствие, высочайшее качество и огромное разнообразие вкусов отборных фруктов. ","mark":"Rich","unit":"л","volumes":[[1.0,56.0,true]]}],"Тоник":[{"brand":"Schweppes Tonic","desc":"Газированный напиток с хинином был изобретен в период бритнаского правления в колониальной Индии. С 1783 годая является неизменным олицетворение напитков Schweppes.","mark":"Schweppes","unit":"л","volumes":[[2.0,50.0,true],[1.0,38.0,true],[0.5,32.0,true],[0.33,0.0,false],[0.2,0.0,false]]}],"Тростниковый сахар":[{"brand":"","desc":"","mark":"","unit":"гр","volumes":[[300.0,200.0,true]]}],"Уксус винный":[{"brand":"","desc":"Широко распространен в винодельческих странах (прежде всего – во Франции), его получают путем сбраживания виноградных вин или соков. Большое количество содержащихся в них эфиров придает уксусу приятный запах. ","mark":"","unit":"л","volumes":[[0.5,150.0,true]]}],"Устрица":[{"brand":"","desc":"Морской двустворчатый моллюск, многие виды которого пригодны в пищу.\nУстрицы имеют низкий процент жирности. Они богаты минералами и витаминами.","mark":"","unit":"шт","volumes":[[1.0,120.0,true]]}],"Устричный соус":[{"brand":"","desc":"Густой коричневый соус из протертого устричного мяса, соли и соевого соуса. Служит пикантной приправой.","mark":"","unit":"л","volumes":[[0.2,200.0,true]]}],"Фиалковый ликер":[{"brand":"Monin Creme de Violette","desc":"С 1912 года Monin производит во Франции не только отличные сиропы, но и качественные ликеры. Богатые изобилием ароматов фруктов и цветовых оттенков. ","mark":"Monin","unit":"л","volumes":[[0.7,754.0,true]]}],"Фиалковый сироп":[{"brand":"Monin Violette","desc":"Monin производит отличные сиропы во Франции с 1912 г. Богат изобилием ароматов, фруктов и цветовых оттенков. Бармены 32 стран признали Monin - лучшей маркой сиропов.","mark":"Monin","unit":"л","volumes":[[0.7,382.0,true]]}],"Физалис":[{"brand":"","desc":"Плоды округло-овальные, жёлто-оранжевые. Вкус кисло-сладкий с земляничным привкусом и ароматом.","mark":"","unit":"шт","volumes":[[1.0,5.0,true]]}],"Халапеньо":[{"brand":"","desc":"Хелапеньо – разновидность перца чили, небольшого размера, который ценят за особую остроту и жгучесть, остающуюся во рту после еды. По шкале жгучести показатели халапеньо колеблются между 2 500 и 10 000 единиц Scoville. Свежий перец при разделке может сильно обжечь руки, поэтому многие повара пользуются латексными перчатками.","mark":"","unit":"шт","volumes":[[1.0,10.0,true]]}],"Херес сладкий":[{"brand":"","desc":"Херес - крепленое благородное вино темно-коричневого цвета, изобретенное примерно пятьсот лет назад в Испании. Англичане же называют этот напиток  шерри и считают прекрасным аперитивом.\n","mark":"","unit":"л","volumes":[[0.7,792.0,true]]}],"Холодный белый чай":[{"brand":"Nestea Vita'O white","desc":"Холодный чай Nestea - натуральный прохладительный напиток на основе чая и фруктового сока. Обладает приятным вкусом с легкой кислинкой.","mark":"Nestea","unit":"л","volumes":[[0.5,46.0,true],[1.5,72.0,true]]}],"Холодный зеленый чай":[{"brand":"Nestea Vita'O green","desc":"Холодный чай Nestea - натуральный прохладительный напиток на основе чая и фруктового сока. Обладает приятным вкусом с легкой кислинкой.","mark":"Nestea","unit":"л","volumes":[[0.5,46.0,true],[1.5,72.0,true]]}],"Холодный персиковый чай":[{"brand":"Nestea Peach","desc":"Холодный чай Nestea - натуральный прохладительный напиток на основе чая и фруктового сока. Обладает приятным вкусом с легкой кислинкой.","mark":"Nestea","unit":"л","volumes":[[0.5,46.0,true],[1.5,72.0,true]]}],"Хрен":[{"brand":"","desc":"Во все времена хрен использовался в качестве лекарственного средства и постепенно стал входить в состав многих препаратов. Содержит большое количество витамина С, каротин, минеральные соли. Так же в состав входят вода, азотные вещества, клетчатка, фитонциды, сахара, ферменты — аспаргин, аргинин, глютамин, синигрин, дающие острый запах и вкус.","mark":"","unit":"гр","volumes":[[100.0,48.0,true]]}],"Черника":[{"brand":"","desc":"Содержит большое количество витамина С. Из-за большого содержания дубильной кислоты является одним из важнейших лекарственных растений. Черника укрепляет зрение и замедляет старение организма. ","mark":"","unit":"гр","volumes":[[500.0,400.0,true]]}],"Чернослив":[{"brand":"","desc":"Чернослив - это сушеная черная слива. Он улучшает состояние кожи, содержит в 1,5 раза больше калия, чем бананы, а так же в нем много железа и витаминов.\n\n\n","mark":"","unit":"гр","volumes":[[300.0,60.0,true]]}],"Черносмородиновый ликер":[{"brand":"Bols Creme de Cassis","desc":"Под торговой маркой Bols выпускается более 30 самых разнообразных ликеров. Бармены всего мира используют его для приготовления всевозможных коктейлей.","mark":"Bols","unit":"л","volumes":[[0.7,885.0,true]]}],"Черный чай":[{"brand":"","desc":"Англичане традиционно предпочитают безупречное качество, считая его залогом благополучия и стабильности. Смесь верхних листьев высокогорного цейлонского чая в совершенном исполнении \"Ахмад\" необычайно богата ароматом, золотистым цветом и характерным вкусом. \n","mark":"","unit":"гр","volumes":[[100.0,100.0,true]]}],"Шиповник":[{"brand":"","desc":"Плоды шиповника являются \"ценным поливитаминным концентратом\". В них содержатся витамины группы В, каротин, аскорбиновая кислота, витамины Р, К, Е. В плодах шиповника витамина С в 10 раз больше, чем в черной смородине и в 50 раз больше, чем в лимоне.\n\n","mark":"","unit":"гр","volumes":[[1000.0,200.0,true]]}],"Шоколад черный":[{"brand":"","desc":"Черный шоколад — самый уважаемый сорт шоколада во всем мире. Его рекомендуют в качестве дополнения к вину или коньяку. Его рекомендуют в качестве дополнения к вину или коньяку. Кроме того, черный шоколад – фаворит в кулинарии. Им не только украшают разнообразные десерты, на его основе делаются ликеры, соусы и муссы.","mark":"","unit":"гр","volumes":[[100.0,25.0,true]]}],"Шоколадное мороженое":[{"brand":"","desc":"","mark":"","unit":"гр","volumes":[[900.0,600.0,true]]}],"Шоколадный сироп":[{"brand":"Monin Chocolat","desc":"Monin производит отличные сиропы во Франции с 1912 г. Богат изобилием ароматов, фруктов и цветовых оттенков. Бармены 32 стран признали Monin - лучшей маркой сиропов.","mark":"Monin","unit":"л","volumes":[[0.7,383.0,true]]}],"Эстрагон":[{"brand":"","desc":"Листья эстрагона применяют как приправу. Его особенно почитали индийские раджи, которым готовили из эстрагона питательный отвар, а также персы - они использовали его для возбуждения аппетита. \n","mark":"","unit":"гр","volumes":[[50.0,42.0,true]]}],"Южный комфорт":[{"brand":"Southern Comfort","desc":"Смесь бурбона, фруктов и огромного числа трав, но точный рецепт знают лишь 8 человек в мире. Известно, что в состав входят апельсины, персики, лимоны, корица и ваниль, а ликер выдерживают в дубовых бочках.","mark":"Southern Comfort","unit":"л","volumes":[[0.75,1500.0,true]]}],"Яблоко зеленое":[{"brand":"","desc":"Содержит много железа, аскорбиновой кислоты, тиамин, рибофлавин, пиридоксин, никотиновую кислоту. Из микроэлементов - яблоки богаты калием, кальцием, фосфором, натрием, железом, молибденом, цинком и барием. ","mark":"","unit":"шт","volumes":[[1.0,25.0,true]]}],"Яблочный ликер":[{"brand":"","desc":"","mark":"","unit":"л","volumes":[[0.7,977.0,true]]}],"Яблочный ликер (зеленый)":[{"brand":"De Kuyper Sour Apple","desc":"Десять поколений семьи De Kuyper входили в состав руководства фирмой, посвятив себя развитию и совершенствованию производства. И сейчас, три века спустя, эта всемирно известная фирма все еще является семейным предприятием. Успех De Kuyper на мировом рынке в значительной мере определяется качеством и методами производства. ","mark":"De Kuyper","unit":"л","volumes":[[0.7,954.0,true]]}],"Яблочный сироп":[{"brand":"Monin Apple","desc":"Monin производит отличные сиропы во Франции с 1912 г. Богат изобилием ароматов, фруктов и цветовых оттенков. Бармены 32 стран признали Monin - лучшей маркой сиропов.\n","mark":"Monin","unit":"л","volumes":[[0.7,382.0,true]]}],"Яблочный сок":[{"brand":"Яблочный сок Rich","desc":"Соки Rich - неповторимое удовольствие, высочайшее качество и огромное разнообразие вкусов отборных фруктов. ","mark":"Rich","unit":"л","volumes":[[1.0,57.0,true]]}],"Ягодный морс":[{"brand":"Морс Ягодный сбор Чудо-Ягода","desc":"Чудо ягода - неповторимое удовольствие, высочайшее качество и огромное разнообразие вкусов отборных ягод.","mark":"Чудо-Ягода","unit":"л","volumes":[[1.0,76.0,true]]}],"Яичный ликер":[{"brand":"Bols Advocaat","desc":"Под торговой маркой Bols выпускается более 30 самых разнообразных ликеров. Бармены всего мира используют его для приготовления всевозможных коктейлей.","mark":"Bols","unit":"л","volumes":[[0.7,885.0,true]]}],"Яйцо":[{"brand":"","desc":"Яйца содержат множество ценнейших веществ, в том числе лютеин и лецитин. Белки, содержащиеся в яйцах, превосходят по биологической ценности белки, содержащиеся в любых других продуктах. Яичный белок является более эффективным строительным материалом для мышц, чем белки из других источников, включая молоко и говядину. В яйцах содержится витамин B12, необходимый для расщепления жиров.","mark":"","unit":"шт","volumes":[[10.0,47.0,true]]}]}